import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function CCard(main) {
  return (
    <Card
      id={main.id}
      key={main.id}
      name={main.name}
      img={main.imgURL}
      tel={main.phone}
      email={main.email}
    />
  );
}

